import React from 'react';
import Navigation from '../components/Navigation';

const About = () => {
    return (
        <div className="about">
            <Navigation />
            <div className="header">
                <h2>Nous estimons que tout le monde mérite d'avoir une belle peau.</h2>
                <p>En 2018, lorsque nous avons créé Maca, notre objectif était simple : permettre à tout le monde d'avoir une belle peau. Depuis, nous nous employons tous les jours à créer les formules les plus originales, les plus pures et les plus efficaces dans le domaine des soins de la peau.</p>
                <p>Nous avons parcouru le monde à la recherche de matières premières naturelles de qualité irréprochable et provenant de sources éthiques. Nous avons longuement cherché avant de trouver des huiles essentielles de qualité thérapeutique distillées à la vapeur. Nos huiles végétales de qualité alimentaire pressées à froid proviennent d'une cueillette manuelle. Nous avons voulu visiter les usines qui recycleront et réutiliseront nos emballages biodégradables.</p>
                <p>Nos objectifs : que vous soyez satisfait(e) de votre peau et que votre routine quotidienne de soin de la peau soit vraiment un plaisir.</p>
            </div>

            <div className="container-bg">
                <div className="bg-img"></div>
            </div>

        </div>
    );
};

export default About;
